import React, {Component} from 'react';
import BannerProductService from '../components/BannerProductService.js';


export default class ProductService extends Component {
    render(){
        return(
            <div style={{paddingBottom: 140}}>
                <BannerProductService />
                <div style={{display: 'flex', justifyContent: 'center'}}>
                    <div style={{width: '84%', display: 'flex'}}>
                        <div style={{paddingTop: 39, width: 773}}>
                            <div style={{fontSize: 24, fontFamily: 'Roboto', color: '#2C2C2C', lineHeight: 1.5}}>Sức trẻ của NOVAS nỗ lực làm hài lòng khách hàng trên cơ sở lắng nghe, nghĩ hay và làm tốt với nhiệt huyết cao nhất</div>
                        </div>
                        <div style={{paddingTop: 30}}>
                            asdasds
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
